import React from 'react'

function Movie(country) {
  return (
    <div>
      <img src={country.flag} alt={country.name}/>
      <p>Patrick</p>
      <p>{country.region}</p>
      <p>{country.capital}</p>
    </div>
  )
}

export default Movie
